pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract NFTContract is ERC721 {
    uint256 private tokenIdCounter;
    mapping(address => bool) private isMinted;
    uint256 public maxSupply;

    constructor(
        string memory _name,
        string memory _symbol,
        uint256 _maxSupply
    ) ERC721(_name, _symbol) {
        tokenIdCounter = 0;
        maxSupply = _maxSupply;
    }

    function mint(address _account) public {
        require(!isMinted[_account], "Already minted NFT for the account");
        require(tokenIdCounter < maxSupply, "Maximum supply reached");

        _safeMint(_account, tokenIdCounter);
        tokenIdCounter++;
        isMinted[_account] = true;
    }
}
"},"contracts/DAOContract.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

// DAO contract

contract DAOContract {
    mapping(address => bool) public members;
    mapping(address => bool) public canVote;
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function addMember(address _member) external onlyOwner {
        require(!members[_member], "Member already exists");

        members[_member] = true;
        canVote[_member] = true;
    }

    function removeMember(address _member) external onlyOwner {
        require(members[_member], "Member does not exist");

        delete members[_member];
        delete canVote[_member];
    }

    function vote(uint _proposalId, bool _support) external {
        require(canVote[msg.sender], "Not authorized to vote");

        // Vote on a specific proposal
    }
}
"},"contracts/PriceConverter.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConverter {
    function getPrice(
        AggregatorV3Interface priceFeed
    ) internal view returns (uint256) {
        // ABI
        // Address passed on from constructor in Paylock.sol

        (, int256 price, , , ) = priceFeed.latestRoundData();
        //    typecaseting & ETH/USD rate in 18 digit
        return uint256(price * 1e10);
    }

    function getConversionRate(
        uint256 tokenAmount,
        AggregatorV3Interface priceFeed
    ) internal view returns (uint256) {
        uint256 tokenPrice = getPrice(priceFeed);
        uint256 tokenAmountInUsd = (tokenAmount * tokenPrice) / 1e18;
        return tokenAmountInUsd;
    }

    function getMaxRate(
        uint256 MAXIMUM_FEE_USD,
        AggregatorV3Interface priceFeed
    ) internal view returns (uint256) {
        uint256 tokenPrice = getPrice(priceFeed);
        uint256 MaxFee = (MAXIMUM_FEE_USD / tokenPrice);
        return MaxFee;
    }
}
"},"@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol":{"content":"// SPDX-License-Identifier: MIT
